    "Cockpit is a server manager that makes it easy to administer your Linux servers via a web browser. Jumping between the terminal and the web tool is no problem. A service started via Cockpit can be stopped via the terminal. Likewise, if an error occurs in the terminal, it can be seen in the Cockpit journal interface.": [ null, "Cockpit és una eina de gestió de servidors que facilita l'administració dels vostres servidors Linux a través d'un navegador web. Saltar entre el terminal i l'eina web no és cap problema. Un servei iniciat a través de Cockpit es pot aturar a través del terminal. De la mateixa manera, si es produeix un error en el terminal, es pot observar en la interfície de les publicacions de Cockpit." ],
