    "Cockpit is perfect for new sysadmins, allowing them to easily perform simple tasks such as storage administration, inspecting journals and starting and stopping services. You can monitor and administer several servers at the same time. Just add them with a single click and your machines will look after its buddies.": [ null, "Cockpit és perfecte per als nous administradors de sistemes, els permet realitzar fàcilment les tasques senzilles com ara l'administració de l'emmagatzematge, la inspecció de les publicacions i iniciar i aturar els serveis. Podeu monitorar i administrar diversos servidors a la vegada. Només heu d'afegir-los amb tan sols un clic i les vostres màquines es veuran al cantó de les altres." ],
